var fileJSON=[{"path":"/home/tf-diego/Escritorio/Kernels/MatrixMult/matrix_mult/device/../host/inc/matrixMult.h", "name":"matrixMult.h", "has_active_debug_locs":false, "absName":"/home/tf-diego/Escritorio/Kernels/MatrixMult/matrix_mult/host/inc/matrixMult.h", "content":"// Copyright (C) 2013-2018 Altera Corporation, San Jose, California, USA. All rights reserved.\012// Permission is hereby granted, free of charge, to any person obtaining a copy of this\012// software and associated documentation files (the \"Software\"), to deal in the Software\012// without restriction, including without limitation the rights to use, copy, modify, merge,\012// publish, distribute, sublicense, and/or sell copies of the Software, and to permit persons to\012// whom the Software is furnished to do so, subject to the following conditions:\012// The above copyright notice and this permission notice shall be included in all copies or\012// substantial portions of the Software.\012// \012// THE SOFTWARE IS PROVIDED \"AS IS\", WITHOUT WARRANTY OF ANY KIND,\012// EXPRESS OR IMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES\012// OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE AND\012// NONINFRINGEMENT. IN NO EVENT SHALL THE AUTHORS OR COPYRIGHT\012// HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER LIABILITY,\012// WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING\012// FROM, OUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR\012// OTHER DEALINGS IN THE SOFTWARE.\012// \012// This agreement shall be governed in all respects by the laws of the State of California and\012// by the laws of the United States of America.\012\012#ifndef MATRIXMULT_H\012#define MATRIXMULT_H\012\012// Block size. Affects the kernel, so if this value changes, the kernel\012// needs to be recompiled.\012#ifndef BLOCK_SIZE\012#define BLOCK_SIZE 32 // default value\012#endif\012\012#endif\012\012"}, {"path":"/home/tf-diego/Escritorio/Kernels/MatrixMult/matrix_mult/device/matrix_mult.cl", "name":"matrix_mult.cl", "has_active_debug_locs":true, "absName":"/home/tf-diego/Escritorio/Kernels/MatrixMult/matrix_mult/device/matrix_mult.cl", "content":"// Copyright (C) 2013-2018 Altera Corporation, San Jose, California, USA. All rights reserved.\012// Permission is hereby granted, free of charge, to any person obtaining a copy of this\012// software and associated documentation files (the \"Software\"), to deal in the Software\012// without restriction, including without limitation the rights to use, copy, modify, merge,\012// publish, distribute, sublicense, and/or sell copies of the Software, and to permit persons to\012// whom the Software is furnished to do so, subject to the following conditions:\012// The above copyright notice and this permission notice shall be included in all copies or\012// substantial portions of the Software.\012// \012// THE SOFTWARE IS PROVIDED \"AS IS\", WITHOUT WARRANTY OF ANY KIND,\012// EXPRESS OR IMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES\012// OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE AND\012// NONINFRINGEMENT. IN NO EVENT SHALL THE AUTHORS OR COPYRIGHT\012// HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER LIABILITY,\012// WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING\012// FROM, OUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR\012// OTHER DEALINGS IN THE SOFTWARE.\012// \012// This agreement shall be governed in all respects by the laws of the State of California and\012// by the laws of the United States of America.\012\012// This kernel computes C = A * B, where\012//  A is a N x K matrix\012//  B is a K x M matrix\012//  C is a N x M matrix\012// All dimensions must be a multiple of BLOCK_SIZE (defined below).\012//\012// The ND-range is two-dimensional and corresponds to the dimensions of matrix\012// C. Each work-item computes one element of the output matrix.\012//\012// The implemented algorithm uses blocking to take advantage of data reuse\012// across multiple elements in matrix C. This is just like the standard loop\012// tiling optimization often used in matrix multiplication implementations.\012//\012// This kernel is intended to be compiled with the following compiler flags:\012//  --no-interleaving default\012//    This flag indicates that the global memory is divided into two logical\012//    banks and allows the host program to assign buffers to specific buffers.\012//    This allows the host to manage the load on each memory bank, usually\012//    to maximize the memory bandwidth usage.\012//\012//    This flag is used for matrix multiplication because there are\012//    two primary memory accesses: reads from matrix A and reads from\012//    matrix B. To maximize memory bandwidth, the two input matrices\012//    are placed in different memory banks, which ensures that there is no\012//    contention when trying to read elements from both matrices\012//    simultaneously.\012// \012//  -fp-relaxed=true\012//    This flag enables the order of additions in the dot product \012//    computation within a block to be rearranged. This enables the additions\012//    to be computed more efficiently in hardware, using a tree structure\012//    instead of a vine. \012//\012//    As a simple example, take the addition of four values: a0 + a1 + a2 + a3.\012//    The default implementation (without -fp-relaxed=true) is:\012//      (((a0 + a1) + a2) + a3)\012//    which matches the standard ordering of operations. In hardware, this\012//    looks like:\012//         a0   a1\012//          |-+-|\012//            |   a2\012//            |-+-|\012//              |   a3\012//              |-+-|\012//                |\012//\012//    With -fp-relaxed=true, the implementation is a balanced tree:\012//      ((a0 + a1) + (a2 + a3))\012//    In hardware, this looks like:\012//          a0   a1   a2   a3\012//           |-+-|     |-+-|\012//             |         |\012//             |----+----|\012//                  |\012//\012// There are two values that need to be defined in the preprocessor.\012//  BLOCK_SIZE\012//    The dimension of the block used in the core computation\012//    is BLOCK_SIZE x BLOCK_SIZE. This is defined in the host\012//    include file because the host needs to know too (just to\012//    ensure that the matrix sizes are a multiple of the block\012//    size.\012//  SIMD_WORK_ITEMS\012//    This value tells the compiler how many work-items in the work-group\012//    in a SIMD fashion. In the context of matrix multiplication, this\012//    value indicates how many output elements will be computed\012//    in a SIMD manner. BLOCK_SIZE must be a multiple of SIMD_WORK_ITEMS.\012//    See the Optimization Guide for details about this attribute.\012//\012//  The combination of these values determines the number of floating-point\012//  operations per cycle.\012\012#include \"../host/inc/matrixMult.h\"\012#ifndef SIMD_WORK_ITEMS\012#define SIMD_WORK_ITEMS 2 // default value\012#endif\012\012\012/**************************************************************************************************\012Definición de funciones de activación:\012    - 0: Ninguna\012    - 1: relu(x)\012    - 2: sigmoid(x)\012    - 3: tan_h(x)\012    - 4: softmax(x)\012***************************************************************************************************/\012\012/*\012Función de activacion relu.\012Si x > 0  -> y = 1\012Si x <= 0 -> y = 0\012Entradas: \012    - x: Valor de entrada\012Salidas: \012    - y: Valor de salida\012*/\012float relu(float x) {\012    if (x > 0) {\012        return x;\012    }\012    else {\012        return 0.0;\012    }\012}\012\012/*\012Función de activacion tangente hiperbólica en función\012del número e.\012tanh(x)    = (1-e^(-2x)) / (1 + e^(-2x))\012tanh(x/2)  = (1-e^(-x)) / (1 + e^(-x)\012Entradas: \012    - x: Valor de entrada\012Salidas: \012    - y: Valor de salida\012*/\012float tan_h(float x, int control) {\012    x = -x;\012    if (control == 1) {\012        // float mantissa;\012        // int exponent;\012        // mantissa = frexp(x, &exponent);\012        // exponent = exponent + 1;\012        x = 2 * x;\012    }\012    x = exp(x);\012    return ((1 - x) / (1 + x));\012}\012\012/*\012Función de activacion sigmoide.\012Se coge la mantissa y el exponente para operar \012mediante desplazamientos aritmñeticos.\012sigmoid = (tan_h(x/2) + 1) / 2 = exp(tan_h(x/2) + 1) >> 1\012Entradas: \012    - x: Valor de entrada\012Salidas: \012    - y: Valor de salida\012*/\012float sigmoid(float x) {\012    float arg = tan_h(x, 0);\012    return (arg + 1) * 0.5;\012}\012\012/*\012Función de activacion softmax.\012Entradas: \012    - x: Valor de entrada\012Salidas: \012    - y: Valor de salida\012*/\012float softmax(float x) {\012    // float exponent;\012    // exponent = exp(x);\012    // sum_softmax += exponent;\012    return exp(x);\012}\012\012/* \012Mediante el argumento de entrada <act> se decide que función de activación se aplica.\012Si act = 0 -> No se aplica función de activación\012Si act = 1 -> Relu\012Si act = 2 -> Sigmoide = (tanh(x) / 2 ) + 1 = exp(tanh) >> 1 + 1\012Si act = 3 -> Tangente hiperbólica: se toma de opencl directamente\012Si act = 4 -> Softmax\012*/\012__kernel \012__attribute((reqd_work_group_size(BLOCK_SIZE,BLOCK_SIZE,1)))\012__attribute((num_simd_work_items(SIMD_WORK_ITEMS)))\012void matrixMult_16_2_act( // Input and output matrices\012                 __global float *restrict C,\012                 __global float *restrict A,\012                 __global float *restrict B,\012                 __global float *restrict Bias,\012                 __local  float *restrict cache,\012                 // Widths of matrices.\012                 int A_height, int A_width, int B_width, \012                 int act, int ctrl_bias, float const_bias\012                 )\012{\012    // Local storage for a block of input matrices A and B\012    __local float A_local[BLOCK_SIZE][BLOCK_SIZE];\012    __local float B_local[BLOCK_SIZE][BLOCK_SIZE];\012    __local float sum_softmax; // Valor para el sumatorio de la matriz elevada a e⁽⁾\012    __local int   counter;     // Valor para el sumatorio de la matriz elevada a e⁽⁾\012\012    // Block index\012    int block_x = get_group_id(0); // Dimensión de B_width\012    int block_y = get_group_id(1); // Dimensión de B_width\012\012    // Local ID index (offset within a block)\012    int local_x = get_local_id(0); // Índices para B_width\012    int local_y = get_local_id(1); // Índices para A_height\012\012    // Compute loop bounds\012    int a_start = A_width * BLOCK_SIZE * block_y;\012    int a_end   = a_start + A_width - 1;\012    int b_start = BLOCK_SIZE * block_x;\012\012    float running_sum  = 0.0f; \012    float value        = 0.0f; // Valor obtenido después de pasar por la función de activación\012    int total = A_height * B_width - 1;\012\012    // Compute the matrix multiplication result for this output element. Each\012    // loop iteration processes one block of the matrix.\012    for (int a = a_start, b = b_start; a <= a_end; a += BLOCK_SIZE, b += (BLOCK_SIZE * B_width))\012    {\012        // Load the matrices to local memory. Note that the (x, y) indices\012        // are swapped for A_local and B_local. This affects the reads from\012        // A_local and B_local below and result in more efficient hardware.\012        //\012        // This is actually an optimization that the compiler can perform,\012        // but is shown here for illustration purposes.\012        A_local[local_y][local_x] = A[a + A_width * local_y + local_x];\012        B_local[local_x][local_y] = B[b + B_width * local_y + local_x];\012    \012        // Wait for the entire block to be loaded.\012        barrier(CLK_LOCAL_MEM_FENCE);\012\012        // Do the dot product accumulation within this block. Fully unroll the loop.\012        // As a result of the swap of indices above, memory accesses to\012        // A_local and B_local are very efficient because each loop iteration\012        // accesses consecutive elements. This can be seen by unrolling the\012        // loop and analyzing the regions that are loaded:\012        //  A_local[local_y][0..BLOCK_SIZE-1] and\012        //  B_local[local_x][0..BLOCK_SIZE-1]\012        \012        #pragma unroll\012        for (int k = 0; k < BLOCK_SIZE; ++k)\012        {\012            running_sum += A_local[local_y][k] * B_local[local_x][k];\012        }\012\012        // Wait for the block to be fully consumed before loading the next\012        // block.\012        barrier(CLK_LOCAL_MEM_FENCE);\012    }\012    \012    // Se controla si se activa el bías o no. Si hay bías:\012    // Puede ser un valor constante o un vector pasado.\012    // En el caso de que haya un valor constante, \012    // const_bias ha de ser distinto de 0\012    \012    if (ctrl_bias == 1) \012    {\012        if (const_bias != 0) {\012            running_sum = running_sum + const_bias;\012        }\012        else {\012            running_sum = running_sum + Bias[local_x];\012        }\012    }\012    \012    // Del argumento de función de activación, <act> se decide a que función se envía \012    // mediante estructura switch/case\012    // Si act = 0 -> No se aplica función de activación\012    // Si act = 1 -> Relu\012    // Si act = 2 -> Sigmoide = (tanh(x) / 2 ) + 1 = exp(tanh) >> 2 + 1\012    // Si act = 3 -> Tangente hiperbólica: se toma de opencl directamente\012    // Si act = 4 -> Softmax\012    switch (act) \012    {\012        case 0: value = running_sum;           break;\012        case 1: value = relu(running_sum);     break;\012        case 2: value = sigmoid(running_sum);  break;\012        case 3: value = tan_h(running_sum, 1); break;\012        case 4: value = softmax(running_sum);  break;\012    }\012\012    // Se almacena en el buffer de salida si función de activación distinta a \012    // softmax. Si no, se almacena  en la memoria local el resultado de la matriz elevada a e\012    // para recorrer nuevamente la matriz en memoria local y devolverla dividida por el sumatorio\012    // de la matriz elevada a e\012    int i, j = 0;\012    if (act != 4) {\012        C[get_global_id(1) * get_global_size(0) + get_global_id(0)] = value;\012    }\012    else {\012        sum_softmax += value;\012        cache[get_global_id(1) * get_global_size(0) + get_global_id(0)] = value;\012        barrier(CLK_LOCAL_MEM_FENCE);\012        if (counter == total) {\012            for (i = 0; i < B_width; i++) {\012                for (int j = 0; j < A_height; j++) {\012                    C[i * j] = cache[i * j] / sum_softmax;\012                }\012            }\012        }\012        counter += 1;\012    }\012}\012"}];